全品！送料無料キャンペーン実施中！<br>(※一部地域除く詳しくはご利用ガイドをご覧ください)3E自動車エンジン洗浄液5L<br>
リヴァネス社製<br>
<br>
RMC-3E洗浄液はノルウェーのリヴァネス社によって開発された内燃機関洗浄液で、22ヶ国の特許を取得済みです<br>
航空機、船舶用として既に30年を超える実績があり、日本航空や全日空にも納入され、省力化、経費節減、そして空港の環境汚染防止に貢献しています<br>
安全かつ、環境汚染防止に有効です！<br>
生分解度はOECD基準を満足させるものであり、排水による環境汚染がありません<br>
煤煙の発生は80％近く減少させることができます<br>
ディーゼル車・ターボ車の場合は、より大きな効果が得られます<br>
ガソリンエンジンからディーゼル・2サイクル・ロータリーエンジン・4サイクル等幅広く対応します<br>
<br>
用途：バス・トラック・乗用車・オートバイ・船舶・モーターボート・船外機・建設機械・トラクター・刈払機・チェンソー・小型発電機用エンジン・その他<br>
容量：5L<br><img src="http://image.rakuten.co.jp/suncardo/cabinet/sign-banner/700x150-20.jpg" border="0">
